function ngService($http){

	//sp.log('Functions loaded');

	function get(url, tableName, query, queryLimit){

		var qry = query || '^ORDERBYsys_updated_on^ORDERBYDESCsys_updated_on';

		$http.get(url+tableName+'?sysparm_query='+qry+'&sysparm_limit='+queryLimit).then(function successCallback(response) {
			return response.data.result;
		}, function errorCallback(response) {
			// console.log("Unable to perform get request");
			return response;
		});
	}

	function modelReduce(data, modelGroup){
		var obj = {};
		modelGroupKeys.map(function(d){
			obj[d] = data[d];
		});
		return obj;
	}


}
